function App(){

    const [name,setname] = useState("Hello");
    function Submit(){
        setname(name);
    }

 return (
    <div>
      <h1>{name}</h1>
    <input type="text" placeholder="What's Your Name" />
    <button style={{backgroundColor:"black"}} onClick={Submit}>Submit</button>
     
    </div>
   
 )
}
export default App;
